
// Embedded background data URLs (from user's files)
const BG = {
  title: "data:image/png;base64,",
  sub: "data:image/png;base64,",
  isi: "data:image/png;base64,",
  quotes: "data:image/png;base64,",
};

// Helpers
const readAsText = (f) => new Promise(res=>{ if(!f) return res(''); const fr=new FileReader(); fr.onload=()=>res(fr.result); fr.readAsText(f); });
function toTitleCase(s){return (s||'').toLowerCase().replace(/\b([a-z\u00C0-\u024F])/g,m=>m.toUpperCase()).replace(/\b(And|Of|The|A|An|In|On|At|To|For|With|By|Or|From|Vs)\b/gi,x=>x.toLowerCase()).replace(/^\w/,c=>c.toUpperCase());}
function toSentence(s){const t=(s||'').trim();return t? t[0].toUpperCase()+t.slice(1).toLowerCase():t;}
function mdLines(txt){return (txt||'').split(/\r?\n/).map(x=>x.trimEnd());}

async function extractTextFromPDF(file){
  if(!window.pdfjsLib) throw new Error('PDF.js belum termuat. Coba gunakan TXT jika offline.');
  const data = await file.arrayBuffer();
  const pdf = await pdfjsLib.getDocument({data}).promise;
  let text='';
  for(let i=1;i<=pdf.numPages;i++){ const p=await pdf.getPage(i); const c=await p.getTextContent(); text += c.items.map(it=>it.str).join(' ') + "\n\n"; }
  return text;
}

function parseDocument(txt){
  const blocks=[]; let current=null; const lines=mdLines(txt);
  const push=()=>{ if(current){ current.content=current.content.join('\n').trim(); blocks.push(current); current=null; } };
  for(const raw of lines){
    const line=raw.trim();
    const header=line.match(/^#\s*(Judul|SubBab|Isi|Quotes)\b/i);
    if(header){ push(); current={ type:header[1].toLowerCase(), content:[] }; continue; }
    if(/^---+$/.test(line)){ push(); continue; }
    if(!current) current={ type:'isi', content:[] };
    current.content.push(raw);
  }
  push();

  const slides=[];
  for(const b of blocks){
    const type=b.type; const text=b.content;
    if(type==='judul'){
      const nonempty=text.split(/\n/).map(x=>x.trim()).filter(Boolean);
      const S={mode:'judulRight', title:'', subtitle:'', author:'', org:'', date:'', quote:''};
      if(nonempty.length) S.title=nonempty[0];
      for(const l of nonempty.slice(1)){
        let m=l.match(/^(Subtitle|Subjudul)\s*:\s*(.+)$/i); if(m){S.subtitle=m[2]; continue;}
        m=l.match(/^Author\s*:\s*(.+)$/i); if(m){S.author=m[1]; continue;}
        m=l.match(/^(Org|Organisasi|Institusi|Fakultas|Prodi)\s*:\s*(.+)$/i); if(m){S.org=m[2]; continue;}
        m=l.match(/^Date\s*:\s*(.+)$/i); if(m){S.date=m[1]; continue;}
        m=l.match(/^(Quote|Kutipan)\s*:\s*(.+)$/i); if(m){S.quote=m[2]; continue;}
      }
      slides.push(S);
    } else if(type==='subbab'){
      slides.push({mode:'subbab', title:text.replace(/\n+/g,' ').trim()||'Sub-Bab'});
    } else if(type==='quotes'){
      slides.push({mode:'quotes', quote:text});
    } else {
      const arr=text.split(/\n/);
      const titleMatch=arr[0]?.match(/^Title\s*:\s*(.+)$/i);
      const title=titleMatch? titleMatch[1] : (arr[0]||'Isi');
      const bullets=(titleMatch?arr.slice(1):arr).map(s=>s.trim()).filter(Boolean).map(s=>/^(-|\*|•|\d+\.|\d+\)|[a-zA-Z]\))\s*/.test(s)?s:('• '+s));
      slides.push({mode:'isi', title, bullets});
    }
  }
  return slides;
}

function createThumb(bgDataUrl, drawFn){
  const wrap=document.createElement('div'); wrap.className='thumb';
  const canvas=document.createElement('canvas'); canvas.width=1280; canvas.height=720;
  const ctx=canvas.getContext('2d'); const img=new Image();
  img.onload=()=>{ ctx.drawImage(img,0,0,canvas.width,canvas.height); drawFn(ctx,canvas); };
  img.src=bgDataUrl;
  wrap.appendChild(canvas); return wrap;
}

function fitText(ctx,text,x,y,maxWidth,lineHeight,font,color='#0f172a'){
  ctx.font=font; ctx.fillStyle=color;
  const words=(text||'').split(/\s+/); let line=''; let yy=y;
  for(let n=0;n<words.length;n++){ const test=line+words[n]+' '; if(ctx.measureText(test).width>maxWidth && n>0){ ctx.fillText(line,x,yy); line=words[n]+' '; yy+=lineHeight; } else { line=test; } }
  ctx.fillText(line,x,yy);
}

const PREV={ // coords for preview only (px at 1280x720)
  judulRight:{ title:{x:870,y:190,w:300,fs:44,ff:"700 44px 'Gama Sans', Arial"}, subtitle:{x:870,y:270,w:300,fs:24,ff:"400 24px 'Gama Sans', Arial"}, meta:{x:870,y:320,w:300,fs:18,ff:"400 18px 'Gama Serif', Georgia"}, quote:{x:880,y:400,w:290,fs:20,ff:"300 italic 20px 'Gama Sans', Arial"} },
  subbab:{ title:{x:360,y:200,w:820,fs:38,ff:"700 38px 'Gama Sans', Arial",color:"#1b4b8c"}, subtitle:{x:360,y:270,w:820,fs:22,ff:"400 22px 'Gama Sans', Arial"} },
  isi:{ ctitle:{x:160,y:110,w:960,fs:30,ff:"700 30px 'Gama Sans', Arial",color:"#1b4b8c"}, content:{x:160,y:180,w:960,fs:22,ff:"400 22px 'Gama Serif', Georgia"} },
  quotes:{ text:{x:220,y:340,w:880,fs:28,ff:"300 italic 28px 'Gama Sans', Arial"} }
};

function renderPreview(slides){
  const holder=document.getElementById('preview'); holder.innerHTML='';
  slides.forEach((s,i)=>{
    let bg=BG.title; if(s.mode==='subbab') bg=BG.sub; else if(s.mode==='isi') bg=BG.isi; else if(s.mode==='quotes') bg=BG.quotes;
    const el=createThumb(bg,(ctx)=>{
      const A=document.getElementById('autoCase').checked;
      if(s.mode==='judulRight'){
        const P=PREV.judulRight;
        const ttl=A?toTitleCase(s.title):s.title; fitText(ctx, ttl, P.title.x, P.title.y, P.title.w, P.title.fs*1.2, P.title.ff);
        if(s.subtitle) fitText(ctx, A?toSentence(s.subtitle):s.subtitle, P.subtitle.x, P.subtitle.y, P.subtitle.w, P.subtitle.fs*1.3, P.subtitle.ff);
        const meta=[s.author,s.org,s.date].filter(Boolean).join(' · '); if(meta) fitText(ctx, meta, P.meta.x, P.meta.y, P.meta.w, P.meta.fs*1.2, P.meta.ff, '#475569');
        if(s.quote) fitText(ctx, '“'+s.quote+'”', P.quote.x, P.quote.y, P.quote.w, P.quote.fs*1.3, P.quote.ff, '#374151');
      } else if(s.mode==='subbab'){
        const P=PREV.subbab;
        fitText(ctx, s.title, P.title.x, P.title.y, P.title.w, P.title.fs*1.2, P.title.ff, P.title.color);
        if(s.subtitle) fitText(ctx, s.subtitle, P.subtitle.x, P.subtitle.y, P.subtitle.w, P.subtitle.fs*1.2, P.subtitle.ff);
      } else if(s.mode==='isi'){
        const P=PREV.isi;
        fitText(ctx, s.title, P.ctitle.x, P.ctitle.y, P.ctitle.w, P.ctitle.fs*1.2, P.ctitle.ff, P.ctitle.color);
        ctx.font=P.content.ff; ctx.fillStyle='#0f172a';
        const lh=P.content.fs*1.4; let y=P.content.y;
        (s.bullets||[]).forEach(b=>{ ctx.fillText(/^•/.test(b)?b:'• '+b, P.content.x, y); y+=lh; });
      } else if(s.mode==='quotes'){
        const P=PREV.quotes; fitText(ctx, '“'+(s.quote||'')+'”', P.text.x, P.text.y, P.text.w, P.text.fs*1.4, P.text.ff);
      }
      // badge
      ctx.fillStyle='rgba(27,75,140,0.08)'; ctx.fillRect(0,0,170,36);
      ctx.fillStyle='#1b4b8c'; ctx.font="600 16px 'Gama Sans', Arial"; ctx.fillText(String(i+1).padStart(2,'0')+' • '+s.mode, 10, 24);
    });
    holder.appendChild(el);
  });
}

async function parseAndPreview(){
  const f=document.getElementById('inDoc').files[0];
  let text=document.getElementById('rawText').value;
  if(f){
    if(f.name.toLowerCase().endsWith('.pdf')){
      try{ text = await extractTextFromPDF(f); }catch(e){ alert('Gagal baca PDF (offline?). Coba pakai TXT.'); return; }
    } else { text = await readAsText(f); }
    document.getElementById('rawText').value = text;
  }
  const slides=parseDocument(text);
  window.__slides = slides;
  renderPreview(slides);
}

async function generatePPTX(){
  const slides = window.__slides || [];
  if(!slides.length){ alert('Belum ada slide. Klik Preview dulu.'); return; }
  const pptx = new PptxGenJS();
  try{ pptx.defineLayout({ name:'UGM_WIDE', width:13.33, height:7.50 }); pptx.layout='UGM_WIDE'; }catch(e){ pptx.layout='LAYOUT_16x9'; }

  const masterFor = (mode)=>{
    const dataUrl = mode==='judulRight'? BG.title : mode==='subbab'? BG.sub : mode==='isi'? BG.isi : BG.quotes;
    const name = 'BG_'+mode;
    try{
      pptx.defineSlideMaster({
        title: name,
        objects: [
          { image: { data: dataUrl, x: 0, y: 0, w: '100%', h: '100%' } }
        ]
      });
    }catch(e){ /* ignore duplicate define */ }
    return name;
  };

  slides.forEach(s=>{
    const m = masterFor(s.mode);
    const slide = pptx.addSlide({ masterName: m });
    if(s.mode==='judulRight'){
      const T={title:{x:7.80,y:1.40,w:3.20,h:2.40},subtitle:{x:7.80,y:4.00,w:3.20,h:0.90},meta:{x:7.80,y:5.00,w:3.20,h:0.70},quote:{x:7.80,y:5.80,w:3.20,h:0.90}};
      const A=document.getElementById('autoCase').checked;
      const title=A?toTitleCase(s.title||'Judul'):(s.title||'Judul');
      slide.addText(title, {x:T.title.x,y:T.title.y,w:T.title.w,h:T.title.h,fontSize:40,fontFace:'Gama Sans',bold:true,color:'#0f172a',margin:{left:0.12,right:0.12,top:0.06,bottom:0.06},autoFit:true});
      if(s.subtitle){ const st=A?toSentence(s.subtitle):s.subtitle; slide.addText(st, {x:T.subtitle.x,y:T.subtitle.y,w:T.subtitle.w,h:T.subtitle.h,fontSize:22,fontFace:'Gama Sans',color:'#0f172a',margin:{left:0.12,right:0.12,top:0.06,bottom:0.06},autoFit:true}); }
      const meta=[s.author,s.org,s.date].filter(Boolean).join(' · ');
      if(meta) slide.addText(meta, {x:T.meta.x,y:T.meta.y,w:T.meta.w,h:T.meta.h,fontSize:16,fontFace:'Gama Serif',color:'#475569',margin:{left:0.12,right:0.12,top:0.06,bottom:0.06},autoFit:true});
      if(s.quote) slide.addText('“'+s.quote+'”', {x:T.quote.x,y:T.quote.y,w:T.quote.w,h:T.quote.h,fontSize:18,fontFace:'Gama Sans',italic:true,color:'#374151',margin:{left:0.12,right:0.12,top:0.06,bottom:0.06},autoFit:true});
    } else if(s.mode==='subbab'){
      const T={title:{x:3.20,y:1.90,w:8.20,h:1.60},subtitle:{x:3.20,y:2.90,w:8.20,h:0.80}};
      slide.addText(s.title||'Sub-Bab', {x:T.title.x,y:T.title.y,w:T.title.w,h:T.title.h,fontSize:36,fontFace:'Gama Sans',bold:true,color:'#1b4b8c',margin:{left:0.12,right:0.12,top:0.06,bottom:0.06},autoFit:true});
      if(s.subtitle) slide.addText(s.subtitle, {x:T.subtitle.x,y:T.subtitle.y,w:T.subtitle.w,h:T.subtitle.h,fontSize:18,fontFace:'Gama Sans',color:'#0f172a',margin:{left:0.12,right:0.12,top:0.06,bottom:0.06},autoFit:true});
    } else if(s.mode==='isi'){
      const C={ctitle:{x:1.30,y:0.90,w:10.40,h:0.70},content:{x:1.30,y:1.80,w:10.40,h:4.80}};
      slide.addText(s.title||'Isi', {x:C.ctitle.x,y:C.ctitle.y,w:C.ctitle.w,h:C.ctitle.h,fontSize:28,fontFace:'Gama Sans',bold:true,color:'#1b4b8c',margin:{left:0.12,right:0.12,top:0.06,bottom:0.06},autoFit:true});
      if(s.bullets?.length) slide.addText(s.bullets.map(x=>/^•/.test(x)?x:'• '+x).join('\n'), {x:C.content.x,y:C.content.y,w:C.content.w,h:C.content.h,fontSize:20,fontFace:'Gama Serif',color:'#0f172a',lineSpacingMultiple:1.2,paraSpaceBefore:4,paraSpaceAfter:4,margin:{left:0.12,right:0.12,top:0.06,bottom:0.06},autoFit:true});
    } else if(s.mode==='quotes'){
      const Q={text:{x:1.60,y:2.80,w:9.20,h:2.20}};
      slide.addText('“'+(s.quote||'')+'”', {x:Q.text.x,y:Q.text.y,w:Q.text.w,h:Q.text.h,fontSize:26,fontFace:'Gama Sans',italic:true,color:'#0f172a',margin:{left:0.12,right:0.12,top:0.06,bottom:0.06},autoFit:true});
    }
  });

  await pptx.writeFile({ fileName: 'UGM_Auto_Generator.pptx' });
}

window.addEventListener('DOMContentLoaded', ()=>{
  document.getElementById('btnPreview').addEventListener('click', parseAndPreview);
  document.getElementById('btnGenerate').addEventListener('click', generatePPTX);
});
